import { useEffect, useState } from 'react';
import './Paragraphe.css';


function Paragraphe(){
    return(
        <div class="container">
            <div class = "row col-md-5">
                <p class="text-start margin-left fs-1 lh-sm  ">This is a long paragraph written to show how the line-height of an element is affected by our utilities. Classes are applied to the element itself or sometimes the parent element. These classes can be customized as needed with our utility API.</p>
            </div>
        </div>
        
    );
}

export default Paragraphe;
